val dataFrameManutencaoRdd0 = dataframeManutencao.rdd.map{case Row(sensor: String,data: Timestamp, bin: Int, amp: Double) => ((sensor,bin), (data, amp))}
val dataFrameManutencaoRdd1 = dataFrameManutencaoRdd0.join(parSensorBinIds).map{case((a,b), ((c,d),e)) => (c,d,e)}
val dataFrameManutencaoUnfilled = dataFrameManutencaoRdd1.map{case(data,amp,bin) => ((data,bin), amp)}

val dataframeManutencaoFilled1 = (0 to 837).toArray
val dataFrameManutencaoFilled2 = uc.sparkContext.parallelize(dataframeManutencaoFilled1)
val dataFrameManutencaoFilled3 = dataFrameManutencaoFilled2.map{case (a) => (a, new Timestamp(data20070103 + a.toLong*oneday))}
val dataFrameManutencaoFilled4 = dataFrameManutencaoFilled3.map{case (a,b) => (List.fill(313)(b).toArray, bins)}
val dataFrameManutencaoFilled5 = dataFrameManutencaoFilled4.map{case(a,b) => (a.zip(b))}
val dataFrameManutencaoFilled6 = dataFrameManutencaoFilled5.flatMap(list=> list)
val dataFrameManutencaoFilled7 = dataFrameManutencaoFilled6.map{case(data, bin) => ((data, bin.toLong), 0.0)} 
val dataFrameManutencaoFilled8 = dataFrameManutencaoFilled7.leftOuterJoin(dataFrameManutencaoUnfilled).map{case((data,bin), (amp1, amp2)) => 

var ampFinal = amp2 match{
    case Some(amp2) =>amp2
    case None => 0.0
}
(data,bin, ampFinal)}
val dataFrameManutencaoFilled9 = dataFrameManutencaoFilled8.map{case (data:Timestamp, id:Long, amp: Double) => ((id), (data.getTime, amp))}.groupByKey
val dataFrameManutencaoFilled10 = dataFrameManutencaoFilled9.map{case (key, values) =>(key, values.toArray.sortBy(_._1).map{_._2})}
var arrayzao = dataFrameManutencaoFilled10.collect

for( i <- 0 to 312){
   val sensorbin = arrayzao(i)._1
   var timeseries = arrayzao(i)._2.reverse
   for( j <- 0 to (timeseries.size-2)){
      val proximo = timeseries(j+1)
      if(proximo == 0)
         timeseries(j+1)=timeseries(j)
   }
   arrayzao(i)=(sensorbin, timeseries.reverse)
}

val dataframe_testTrainWindow_complete = uc.sql("""SELECT sensorbin, 
                    double(amplitude) amplitude, data
                    FROM manutencaofinal where data >= '2007-01-03' and data < '2007-09-01' order by data""").repartition(5).na.drop.cache

val toBeTestedTrainWindowGrouped = dataframe_testTrainWindow_complete.map{case Row(id:Double, amp: Double, data:Timestamp) => ((id), (data.getTime, amp))}.groupByKey
val toBeTestedTrainWindowGroupedTS = toBeTestedTrainWindowGrouped.map{case (key, values) =>(key, values.toArray.sortBy(_._1).map{_._2})}
val toBeTestedTrainWindowByR = toBeTestedTrainWindowGroupedTS.map{case(a,b) => Row(a, b.sliding(11).toArray)}

